  base: *id012
  body: "The current implementation has a try/except ImportError block around a statement\
    \ that has no imports. This is leftover from some previous changes that didn't\
    \ fully clean up the code.\r\n\r\neee00f8f7e15592a048c8b841aef9ea81faa0fda introduced\
    \ functionality for this module to work when ctypes is not available.\r\n3c1a13dea6a7e189675977ad65ea230ce4816061\
    \ Moved the import statement out of the try/except block and to top file, but\
    \ did not account for behavior when ctypes is not importable."
